export const handelMnueScroll = (e) => {


    const mnue = document.querySelector('.main-menu-content');

    if (mnue.scrollTop >= mnue.scrollHeight - mnue.clientHeight) {

        mnue.scrollTo({
            left: 0,
            top: 0,
            behavior: "smooth"
        });

    } else {
        mnue.scrollBy({

            left: 0,

            top: 100,

            behavior: "smooth"

        });

    }
}